import ReactDOM from "react-dom";

const App = () =>{

    return(
        <>
            <div className="main_div">
                <div className="center_div"></div>
                <br></br>
                <h1> ToDo List</h1>
                <br></br>
            </div>
        </>
    );

}

export default App;
